import React, { useState } from "react";
import axios from "axios";
import Loader from "react-loader-spinner";
import PropTypes from "prop-types";

const ListingForm = (props) => {
  const [formData, setFormData] = useState({
    sale_type: "For Sale",
    price: "$0+",
    bedrooms: "0+",
    home_type: "House",
    bathrooms: "0+",
    sqft: "1000+",
    days_listed: "1 or less",
    has_photos: "1+",
    open_house: "false",
    keywords: "",
  });

  const {
    sale_type,
    price,
    bedrooms,
    home_type,
    bathrooms,
    sqft,
    days_listed,
    has_photos,
    open_house,
    keywords,
  } = formData;

  const [loading, setLoading] = useState(false);

  const OnChange = (e) =>
    setFormData({ ...formData, [e.target.name]: e.target.value });

  const onSubmit = (e) => {
    e.preventDefault();
    axios.defaults.headers = {
      "Content-Type": "application/json",
    };

    setLoading(true);
    axios
      .post("http://localhost:8000/api/listings/search", {
        sale_type,
        price,
        bedrooms,
        home_type,
        bathrooms,
        sqft,
        days_listed,
        has_photos,
        open_house,
        keywords,
      })
      .then((res) => {
        setLoading(false);
        console.log(res.data);
        props.setListings(res.data);
        window.scrollTo(0, 0);
      })
      .catch((err) => {
        setLoading(false);
        window.scrollTo(0, 0);
      });
  };
  return (
    <form className="listingform" onSubmit={(e) => onSubmit(e)}>
      <div className="row">
        <div className="col-1-of-6">
          <div className="listingform__section">
            <label className="listingform__label" htmlFor="Sale_type">
              Sale or Rent
            </label>
            <select
              className="listingform__select"
              name="sale_type"
              value={sale_type}
              onChange={(e) => OnChange(e)}
            >
              <option>For Sale</option>
              <option>For Rent</option>
            </select>
          </div>
          <div className="listingform__section">
            <label className="listingform__label" htmlFor="sqft">
              Sqft
            </label>
            <select className="listingform__select" name="sqft" value={sqft} onChange={(e) => OnChange(e)}>
              <option>1000+</option>
              <option>1200+</option>
              <option>1500+</option>
              <option>2000+</option>
              <option>Any</option>
            </select>
          </div>
        </div>
        <div className="col-1-of-6"></div>
        <div className="col-1-of-6">
          <div className="listingform__section">
            <label className="listingform__label" htmlFor="price">
              Minimum Price
            </label>
            <select className="listingform__select" name="price"value={price} onChange={(e) => OnChange(e)}>
              <option>Rs 0+</option>
              <option>Rs 15,00,000+</option>
              <option>Rs 20,00,000+</option>
              <option>Rs 50,00,000+</option>
              <option>Rs 1,00,00,000+</option>
              <option>Rs 2,50,00,000+</option>
              <option>Rs 5,00,00,000+</option>
              <option>Any</option>
            </select>
          </div>
        </div>
      </div>
    </form>
  );
};

export default ListingForm;
